I have a list of strings that I want to sort case-sensitively. I know that the default sort function sorts case-insensitively, but I want to sort case-sensitively. How can I do this?
var arr = ["a", "A", "b", "B", "c", "C"];
arr.sort();
console.log(arr);
// ["A", "a", "B", "b", "C", "c"]
// I want ["A", "B", "C", "a", "b", "c"]
marked as duplicate by Bergi  javascript May 1 '17 at 14:50
The default sort function does not sort case-insensitively. It sorts by the character code, which means that all uppercase letters come before all lowercase letters. –  Barmar May 1 '17 at 14:48
You can use localeCompare() with the sensitivity option set to "case" :
var arr = ["a", "A", "b", "B", "c", "C"];
arr.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: "case" }));
console.log(arr);
// ["A", "B", "C", "a", "b", "c"]
