You can use the node-xlsx package to read the Excel files and compare the data. Here is an example of how you can do this:
const xlsx = require('node-xlsx');
// Read the first Excel file
const file1 = xlsx.parse('file1.xlsx');
// Read the second Excel file
const file2 = xlsx.parse('file2.xlsx');
// Compare the data in the two files
for (let i = 0; i < file1.length; i++) {
  for (let j = 0; j < file2.length; j++) {
    if (file1[i].name === file2[j].name) {
      // Check if the data in the two files is the same
      if (file1[i].data !== file2[j].data) {
        // If the data is not the same, print the discrepancy
        console.log(`Discrepancy found in row ${i + 1}: ${file1[i].name} - ${file1[i].data} vs ${file2[j].name} - ${file2[j].data}`);
In this example, we are using the parse method of the node-xlsx package to read the Excel files. We are then using a nested for loop to compare the data in the two files. If the data in the two files is not the same, we are printing the discrepancy to the console.
