System.out.println("2. Right");
int choice = scan.nextInt();
if (choice == 1) {
    System.out.println("You go left and find a treasure chest.");
    System.out.println("You go right and find a dragon.");
I want to be able to have multiple choices and have the game respond differently depending on the choice. Is there a better way to do this than using if-else statements?
You can use a switch statement to handle multiple choices in a more organized way. Here's an example:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
int choice = scan.nextInt();
switch (choice) {
        System.out.println("You go left and find a treasure chest.");
        System.out.println("You go right and find a dragon.");
        System.out.println("Invalid choice.");
This way, you can add more choices by simply adding more cases to the switch statement. It's also easier to read and understand than a long chain of if-else statements.

